        React.createElement("path", { d: "M5.7 1.74a.75.75 0 00-1.4 0l-3.5 9.5a.75.75 0 001.4.52l.93-2.51h2.01c.13-.53.33-1.04.6-1.5H3.68L5 4.17l1.11 3.01c.33-.43.73-.82 1.18-1.14L5.7 1.74zm4.8 6.14a.62.62 0 100 1.24.62.62 0 000-1.24zm0 5.12a.5.5 0 00.5-.5v-2a.5.5 0 00-1 0v2c0 .28.22.5.5.5zm0-7a4.5 4.5 0 100 9 4.5 4.5 0 000-9zm0 8a3.5 3.5 0 110-7 3.5 3.5 0 010 7z", fill: primaryFill }));
};
const TextFontInfo16Filled = wrapIcon(rawSvg({}), 'TextFontInfo16Filled');
export default TextFontInfo16Filled;
